import React from 'react';

const SearchList = ({article}) => {
  const Link = `http://en.wikipedia.org/?curid={article.pageid}`;
  return(
    <li className="">
      <a href={Link}>{article.title}</a>
    </li>
  );
}

export default SearchList;
